import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

const Home = () => {
    return (
        <div>
            <Navbar />
            <h1>Welcome to the Data Science Platform</h1>
            <p>Your journey to mastering data science starts here!</p>
            <Footer />
        </div>
    );
};

export default Home;
